import React from "react";

import "./TaskList.css";
import Task from "../Task/Task";
import ButtonSmall from "../ButtonSmall/ButtonSmall";

const TaskList = (props) => {
  const { tasks, listType } = props;
  return (
    <div className="task-list">
      {tasks && tasks.length > 0 ? (
        tasks.map((t) => {
          let delay = tasks.indexOf(t) + 2;
          return (
            <Task
              key={t.id}
              id={t.id}
              type={t.type}
              delay={delay}
              task={t.task}
              cat={t.cat}
            />
          );
        })
      ) : listType === "done" ? (
        <h3 className="no-tasks">Nothing done today</h3>
      ) : (
        <h3 className="no-tasks">no tasks added</h3>
      )}
      <div className="undo-btn">
        <ButtonSmall title="Undo last deleted" color="grey" />
      </div>
    </div>
  );
};

export default TaskList;
